import React from 'react';
import "./styles.css";

function WeatherInfo({ weather }) {
  return (
    <div>
      <h2>Информация о погоде</h2>
      <p>Температура: {parseInt(weather.main.temp) - 273}°C</p>
      <p>Ощущается как: {parseInt(weather.main.feels_like) - 273}°C</p>
      <p>Влажность: {weather.main.humidity}</p>
      <p>Описание: {weather.weather[0].description}</p>
      {weather.url && (
        <p>
          <a href={weather.url} target="_blank" rel="noopener noreferrer">
            Посмотреть больше деталей о погоде
          </a>
        </p>
      )}
    </div>
  );
}

export default WeatherInfo;
